import React from "react";
import Popup from "reactjs-popup";
import "./PopupButton.css";
import StarRating from "./StarRating";
import LikeOrDislike from "./LikeOrDislike";

function PopupButton() {
  return (
    <Popup
      trigger={
        <button className="trips__cards__items__button"> Evaluate </button>
      }
      modal
      nested
    >
      {(close) => (
        <div className="modal">
          <button className="close" onClick={close}>
            &times;
          </button>
          <div className="header"> Evaluate </div>
          <div className="content">
            {" "}
            <div className="content-input">
              Stars:
              <StarRating />
            </div>
            <br />
            <div className="content-input">
              Link/Dislike:
              <LikeOrDislike />
            </div>
            <br />
            <div className="content-input">
              Reviews:<input className="popupInput"></input>
            </div>
          </div>
          <div className="actions">
            <button
              className="sendout__button"
              onClick={() => {
                console.log("Send out ");
                close();
              }}
            >
              Send out
            </button>
          </div>
        </div>
      )}
    </Popup>
  );
}

export default PopupButton;
